import React from 'react'
import { theUrl } from 'selfConfig'

const getAdminList = theUrl + '/getAdminList'

const getList = () => {
    alert(getAdminList)
}

const List = () => {
    getList();

    return(
        <h1>This is list component</h1>
    )
}

export default List;
